nd conditions of this Agreement. Your membership for the Service is for Your sole, personal use. You may not authorize others to use Your membership and You may not assign or otherwise transfer Your account to any other person or entity. </p>\r\n<p><strong>REGISTRATION AND SUBSCRIPTION:</strong> Although You may register as a Member of the Service for free, if You wish to use the Service to initiate most communication with other members and use certain other parts of the Service, You must become a subscriber and pay the fees that are set out. This price list is part of this Agreement And We reserve the right, at any time, to change any fees or charges for using the Service. To become a Member, You must register for the Service. When and if You register to become a Member, You agree to provide accurate, current and complete information about Yourself as prompted by Our registration form ("Registration Data"), and to maintain and update Your information to keep it accurate, current and complete. You agree that We may rely on Your Registration Data as accurate, current and complete. You acknowledge that if Your Registration Data is untrue, inaccurate, not current or incomplete in any respect, We reserve the right to terminate this Agreement and Your use of the Service and, in such event, You shall not be entitled to a refund of any unused subscription fees. </p>\r\n<p><strong>TERM AND TERMINATION: </strong>This Agreement will remain in full force and effect while You use the Service and/or are a Member. You may terminate your membership at any time, for any reason by following the instructions on the Member Services page of the Service, or upon receipt by Us of Your written or email notice of termination. Either You or We may terminate your membership by removing your profile, at any time, for any reason, with or without explanation, effective upon sending written or email notice to the other party. Upon such termination by Us without cause, We shall refund, pro rata, any unused portion of any subscription payments that We have received from You.&nbsp; In the event that (a) You terminate your subscription or membership or (b) We determine, in our sole discretion, that You have violated this Agreement. You shall not be entitled to nor shall We be liable to You for any refund of any unused portion of any subscription payments the We have received from You, and We may continue to bar Your use of the Service in the future. Even after membership is terminated, this Agreement will remain in effect. </p>\r\n<p><strong>PROPRIETARY RIGHTS: </strong>You represent and warrant to Us that the information posted in Your profile including Your photograph are posted by You and that You are the exclusive author of Your profile and the exclusive owner of Your photographs. You assign to Us, with full title guarantee, all copyright in Your profile and your photographs posted, at any time, in connection with Your use of the Service. You waive absolutely any and all moral rights to be identified as author of Your profile and owner of Your photograph and any similar rights in any jurisdiction in the world. In addition, other Members may post copyrighted information, which has copyright protection, whether or not it is identified as copyrighted. Except for that information which is in the public domain or for which You have been given express written permission, You will not copy, modify, publish, transmit, distribute, perform, display, or sell any such proprietary information. By posting information, photographs or content on any Service, You automatically grant, and You represent and warrant that You have the right to grant, to Us and other members, free of charge, an irrevocable, perpetual, non-exclusive, royalty-free, fully-paid, worldwide license to use, copy, perform, display, promote, publish and distribute such information, content and photographs and to prepare derivative works of, or incorporate into other works, such information and content, and to grant and authorize sub-licenses of the foregoing.</p>\r\n<p><strong>YOUR USE OF THE SERVICE:</strong> As a Member, You agree that:</p>\r\n<p>(1) You will use the Service in a manner consistent with any and all applicable laws and regulations. You will not include in Your profile any telephone numbers, street addresses, last names, URL''s or email addresses, other than where You are specifically asked for such information in the Confidential Personal Information section of the Service. You will not engage in advertising to, or solicitation of, other members to buy or sell any products or services through the Service. You will not transmit any chain letters or junk email to other members. You are solely responsible for Your interactions with other members. We reserve the right, but have no obligation, to monitor and/or mediate disputes between You and other members.</p>\r\n<p>(2) You are solely responsible for the content or information You publish or display (hereinafter, "post") on the Service, or transmit to other members. You will not post on the Service, or transmit to other members or to Us or Our employees, any defamatory, inaccurate, abusive, obscene, profane, offensive, sexually oriented, threatening, harassing, racially offensive, or illegal material, or any material that infringes or violates another party''s rights (including, but not limited to, intellectual property rights, and rights of privacy and publicity). You will not include in Your profile any offensive anatomical or sexual references, or offensive sexually suggestive or connotative language, and You will not post any photos containing nudity or personal information. We reserve the right, but We have no obligation, to reject any profile or photo that does not comply with the prohibitions set forth in this section and, to the extent that We determine, in Our sole discretion, to do so, You shall not be entitled to a refund of any unused subscription payments that We have received from You. </p>\r\n<p>(3) Email communications sent from Us or through Us are designed to make your online personals experience enjoyable. By becoming a member, You specifically agree to accept and consent to receiving email communications initiated from Us or through Us including, without limitation: message notification emails, Your Match emails, emails informing you about events and parties We organize, emails informing You of promotions We run and emails informing You of changes to the Service. Should You not wish to receive any of Our email communications, please do not register with Us for the Service. </p>\r\n<p>(4) You agree that We have no responsibility or liability for the deletion, corruption or failure to store any messages or other content maintained or transmitted by Our Service. You acknowledge that features, parameters or other services We provide may change at any time. You acknowledge that We reserve the right to sign out, terminate, delete or purge Your account from the Service if it is inactive. "Inactive" means that you have not signed in to the Service for a particular period of time, as determined by Us, in Our sole discretion (currently, we consider an account to be Inactive after 12 months). </p>\r\n<p>(5) Our customer service employees are here to make your online experience enjoyable by providing assistance and guidance to You. When speaking to Our customer service employees on the phone or communicating with them by any other means, You undertake not to be abusive, obscene, profane, offensive, sexually oriented, threatening, harassing or racially offensive. Should any of Our customer service employees feel, at any given point, threatened or offended by Your conduct, We reserve the right to immediately terminate Your membership and You shall not be entitled to the refund of any subscription payments We have received from You. </p>\r\n<p>We are entitled to investigate and terminate Your membership if You have misused the Service, or behaved in a way which could be regarded as inappropriate, unlawful or illegal. The following is a partial, but not exhaustive, list of the types of actions that are illegal or prohibited under this Agreement: </p>\r\n<p>(a) You will not impersonate any person or entity. <br />(b) You will not "stalk" or otherwise harass any person. <br />(c) You will not express or imply that any statements You make are endorsed by Us, without Our specific prior written consent.<br />(d) You will not use any robot, spider, site search/retrieval application, or other manual or automatic device or process to retrieve, index, "data mine," or, in any way reproduce or circumvent the navigational structure or presentation of the Service or its contents. <br />(e) You will not post, distribute or reproduce, in any way, any copyrighted material, trademarks, or other proprietary information without obtaining the prior consent of the owner of such proprietary rights. <br />(f) You will not remove any copyright, trademark or other proprietary rights notices contained in the Service. <br />(g) You will not interfere with or disrupt any Service or any site, servers or networks connected to any Service or site. <br />(h) You will not post, email or otherwise transmit any material that contains software viruses or any other computer code, files or programs designed to interrupt, destroy or limit the functionality of any computer software or hardware or telecommunications equipment. <br />(i) You will not forge headers or otherwise manipulate identifiers in order to disguise the origin of any information transmitted through the Service. <br />(j) You will not "frame" or "mirror" any part of the Service, without Our specific prior written consent. <br />(k) You will not use meta tags or code or other devices containing any reference to Us or the Service or the site connected to the Service in order to direct any person to any other web site for any purpose. <br />(l) You will not modify, adapt, sublicense, translate, sell, reverse engineer, decipher, decompile or otherwise disassemble any portion of the Service or any software used on or for the Service or cause or enable others to do so.</p>\r\n<p><strong>INDEMNITY BY MEMBER:</strong> You will defend, indemnify, and hold Us and Our officers, directors, employees, agents and third parties harmless, for any losses, costs, liabilities and expenses (including reasonable attorneys'' fees) relating to or arising out of Your use of the Service, including: </p>\r\n<p>(I) Your breach of this Agreement; (II) any allegation that any materials that You submit to Us or transmit to the Service infringe or otherwise violate the copyright, trademark, trade secret or other intellectual property or other rights of any third party; and/or (III) Your activities in connection with the Service. This indemnity shall be applicable without regard to the negligence of any party, including any indemnified person. </p>\r\n<p><strong>ONLINE CONTENT:</strong> Opinions, advice, statements, offers, or other information or content made available through the Service, but not directly by Us, are those of their respective authors, and should not necessarily be relied upon. Such authors are solely responsible for such content. WE DO NOT GUARANTEE THE ACCURACY, COMPLETENESS, OR USEFULNESS OF ANY INFORMATION ON THE SERVICE AND WE NEITHER ADOPT NOR ENDORSE NOR ARE WE RESPONSIBLE FOR THE ACCURACY OR RELIABILITY OF ANY OPINION, ADVICE, OR STATEMENT MADE BY PARTIES OTHER THAN US. UNDER NO CIRCUMSTANCES ARE BE RESPONSIBLE FOR ANY LOSS OR DAMAGE RESULTING FROM ANYONE''S RELIANCE ON INFORMATION OR OTHER CONTENT POSTED ON THE SERVICE, OR TRANSMITTED TO MEMBERS. </p>\r\n<p>WE RESERVE THE RIGHT, BUT WE HAVE NO OBLIGATION, TO MONITOR THE MATERIALS POSTED IN THE PUBLIC AREAS OF THE SERVICE. WE SHALL HAVE THE RIGHT TO REMOVE ANY SUCH MATERIAL THAT, IN OUR SOLE DISCRETION, VIOLATES, OR IS ALLEGED TO VIOLATE, THE LAW OR THIS AGREEMENT. NOTWITHSTANDING THIS RIGHT, YOU REMAIN SOLELY RESPONSIBLE FOR THE CONTENT OF THE MATERIALS YOU POST IN THE PUBLIC AREAS OF THE SERVICE AND IN YOUR PRIVATE EMAIL MESSAGES. EMAILS SENT BETWEEN YOU AND OTHER MEMBERS THAT ARE NOT READILY ACCESSIBLE TO THE GENERAL PUBLIC WILL BE TREATED BY US AS PRIVATE TO THE EXTENT REQUIRED BY APPLICABLE LAW. </p>\r\n<p><strong>INTELLECTUAL PROPERTY. </strong>All intellectual property rights in and to the Service are and shall be owned by Us, absolutely.&nbsp; Those rights include, but are not limited to, database rights, copyright, design rights (whether registered or unregistered), trademarks (whether registered or unregistered) and other similar rights, wherever existing in the world, together with the right to apply for protection of the same. All other trademarks, logos, service marks, company or product names set forth in Service are the property of their respective owners. </p>\r\n<p><strong>PRIVACY:</strong> The personal information (including sensitive personal information) You provide to Us will be stored on computers. You consent to Our using this information to build up a profile of interests, preferences and browsing patterns and to allow You to participate in the Service. You also agree to read, review, comply with, uphold and maintain Our terms and conditions thereof. If you are located outside of the United States, please note that the information that you provide is being sent to the United States. By becoming a member of the Service, you consent to your data being sent to the United States and to such other third parties and jurisdictions as may be involved in the provision and operation of the Service...</p>\r\n<p><strong>DISCLAIMERS:</strong> WE PROVIDE THE SERVICE ON AN "AS IS" BASIS AND GRANT NO WARRANTIES OF ANY KIND, EXPRESSED, IMPLIED, STATUTORY, IN ANY COMMUNICATION WITH OUR REPRESENTATIVES, OR US OR OTHERWISE WITH RESPECT TO THE SERVICE. WE SPECIFICALLY DISCLAIM ANY IMPLIED WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, OR NON-INFRINGEMENT. FURTHER, WE DO NOT WARRANT THAT YOUR USE OF THE SERVICE WILL BE SECURE, UNINTERRUPTED, ALWAYS AVAILABLE OR ERROR-FREE OR THAT THE SERVICE WILL MEET YOUR REQUIREMENTS OR THAT ANY DEFECTS IN THE SERVICE WILL BE CORRECTED WE DISCLAIM LIABILITY FOR, AND NO WARRANTY IS MADE WITH RESPECT TO, CONNECTIVITY AND AVAILABILITY. </p>\r\n<p>Although each member must agree to Our terms and conditions, We cannot guarantee that each member is at least the required minimum age, nor do we accept responsibility or liability for any content, communication or other use or access of the Service by persons under the age of 18 in violation of this Agreement. Also, it is possible that other members or users (including unauthorized users, or "hackers") may post or transmit offensive or obscene materials on the Service and that You may be involuntarily exposed to such offensive and obscene materials. It also is remotely possible for others to obtain personal information about You due to Your use of the Service, and that the recipient may use such information to harass or injure You. We are not responsible for the use of any personal information that You disclose on the Service. Please carefully select the type of information that You post on the Service or release to others. WE DISCLAIM ALL LIABILITY, REGARDLESS OF THE FORM OF ACTION, FOR THE ACTS OR OMISSIONS OF OTHER MEMBERS OR USERS (INCLUDING UNAUTHORIZED USERS), WHETHER SUCH ACTS OR OMISSIONS OCCUR DURING THE USE OF THE SERVICE OR OTHERWISE. </p>\r\n<p><strong>LIMITATION OF LIABILITY: </strong>IN NO EVENT WILL WE BE LIABLE TO YOU FOR ANY INCIDENTAL, CONSEQUENTIAL, OR INDIRECT DAMAGES (INCLUDING, BUT NOT LIMITED TO, DAMAGES FOR LOSS OF DATA, LOSS OF PROGRAMS, COST OF PROCUREMENT OF SUBSTITUTE SERVICES OR SERVICE INTERRUPTIONS) ARISING OUT OF THE USE OF OR INABILITY TO USE THE SERVICE, EVEN IF WE OR OUR AGENTS OR REPRESENTATIVES KNOW OR HAVE BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGES, OR TO ANY PERSON OTHER THAN YOU. NOTWITHSTANDING ANYTHING TO THE CONTRARY CONTAINED HEREIN, OUR LIABILITY TO YOU FOR ANY CAUSE WHATSOEVER, AND REGARDLESS OF THE FORM OF THE ACTION, WILL AT ALL TIMES BE LIMITED TO THE AMOUNT PAID, IF ANY, BY YOU TO US FOR THE SERVICE DURING THE TERM OF YOUR MEMBERSHIP. <br />WE DO NOT CONDUCT BACKGROUND CHECKS OR OTHERWISE SCREEN THE MEMBERS REGISTERING TO THE SERVICE IN ANY WAY. AS A RESULT, WE WILL NOT BE LIABLE FOR ANY DAMAGES, DIRECT, INDIRECT, INCIDENTAL AND/OR CONSEQUENTIAL, ARISING OUT OF THE USE OF THIS SERVICE, INCLUDING, WITHOUT LIMITATION, DAMAGES ARISING OUT OF COMMUNICATING AND/OR MEETING WITH OTHER MEMBERS OF THE SERVICE, OR INDIVIDUALS INTRODUCED TO YOU VIA THE SERVICE. SUCH DAMAGES INCLUDE, WITHOUT LIMITATION, PHYSICAL DAMAGES, BODILY INJURY AND OR EMOTIONAL DISTRESS AND DISCOMFORT.</p>\r\n<p><strong>COMPLAINTS:</strong> To resolve a complaint regarding the Service, You should first contact Our customer service department by clicking: <a href="feedback.php" target="new">contact us</a>. </p>\r\n<p><strong>DISPUTE RESOLUTION:</strong> This Agreement is governed by the laws of the State of California without regard to its conflict of law provisions. You agree to personal jurisdiction by and venue in the state and federal courts of the State of California, City of Los Angeles. This Agreement shall not be governed by the United Nations Convention on Contracts for the International Sale of Goods, the application of which is hereby expressly excluded.</p>');
INSERT INTO `[prefix]_pages` (`id`, `pagekey`, `title`, `pagetext`) VALUES (2, 'privacy', 'Privacy Statement', 'The owners of this Service have created this Privacy Statement (Policy) in order to demonstrate our firm commitment to help our users better understand what information we collect about them and what may happen to that information.\r\n<p>The following discloses our information gathering and dissemination practices for the Websites listed below. </p>\r\n<p><b>Overview</b></p>\r\n<p>As part of the normal operation of our services we collect and, in some cases, may disclose information about you. This Privacy Policy describes the information we collect about you and what may happen to that information. By accepting this Privacy Policy and our Terms and Conditions, you expressly consent to our use and disclosure of your personal information in the manner prescribed in this Privacy Policy. This Privacy Policy is incorporated into and subject to the terms of the&nbsp;Terms and Conditions. </p>\r\n<p>This Privacy Statement applies to all&nbsp;related sites. All other &nbsp;worldwide sites operate under similar privacy practices as described in this Privacy Policy, and subject to the requirements of applicable local law, we strive to provide a consistent set of privacy practices throughout the&nbsp; online personals sites.</p>\r\n<p>1. <b>A Special Note About Children</b></p>\r\n<p>Children are not eligible to use our services, and we ask that minors (under the age of 18) do not submit any personal information to us. If you are a minor, you can use this service only in conjunction with your parents or guardians. </p>\r\n<p>2. <b>Information We Collect</b></p>\r\n<p>Our primary goal in collecting personal information is to provide you with a smooth, efficient, and customized experience. This allows us to provide services and features that most likely meet your needs and to customize our service to make your experience easier. You agree that in order to assist our members to meet each other we may feature members'' profiles in our editorials and newsletters that we send out from time to time to our members. Your name, address and telephone number are confidential and will not be posted in your profile. Your profile is available for other members to view. Members'' profiles include a description and photos, likes and dislikes, individual essays and other information helpful in determining matches. Your viewable profile does not include any identifying information about you, except the username you chose upon registering. </p>\r\n<p>Please note that your personally identifiable information will be stored and processed on our computers in the United States. The laws on holding personal data in the United States may differ from the European laws but as we explain below, We will hold and transmit your information in a safe, confidential and secure environment. </p>\r\n<p>We automatically track certain information based upon your behavior on our Websites using cookies and other devices. We use this information for internal research on our members'' demographics, interests, and behavior to better understand and serve you and our community. This information may include the URL that you just came from (whether this URL is on our site or not). Which URL you next go to (whether this URL is on our site or not), what browser you are using, and your IP address. </p>\r\n<p>We use data collection devices such as "cookies" on certain pages of our Websites. "Cookies" are small files placed on your hard drive that assist us in providing customized services. We also offer certain features that are only available through the use of a "cookie". Cookies can also help us provide information which is targeted to your interests. Most cookies are "session cookies", meaning that they are automatically deleted from your hard drive at the end of a session. You are always free to decline our cookies if your browser permits. </p>\r\n<p>We use a third party advertising company, to serve ads on our behalf across the Internet. The third party may also collect anonymous information about your visits to our Web site. This is primarily accomplished through the use of a technology device, commonly referred to as a Web beacon or an action tag, which we place on various Web pages within our Web site or in an html e-mail that allows Atlas DMT to collect anonymous information. Atlas DMT may use information about your visits to this and other Web sites in order to provide ads about goods and services of interest to you. </p>\r\n<p>3. <b>Our Use of Your Information</b></p>\r\n<p>We use information in the files we maintain about you, and the other information we obtain from your current and past activities on the Websites to resolve disputes, troubleshoot problems and enforce our Terms and Conditions. At times, we may look across multiple members to identify problems or resolve disputes, and in particular we may examine your information to identify members multiple Member ID No. or aliases. </p>\r\n<p>You agree that we may use personally identifiable information about you to improve our marketing and promotional efforts, to analyze site usage, improve our content and product offerings, and customize our Site''s content, layout, and services. These uses improve our site and better tailor it to meet your needs. </p>\r\n<p>You agree that we may use your information to contact you and deliver information to you that, in some cases, are targeted to your interests, such as targeted banner advertisements, administrative notices, product offerings, and communications relevant to your use on the Websites. By accepting this Privacy Policy, you expressly agree to receive this information. </p>\r\n<p>4. <b>Our Disclosure of Your Information</b></p>\r\n<p>Due to the existing regulatory environment, we cannot ensure that all of your private communications and other personally identifiable information will never be disclosed in ways not otherwise described in this Privacy Policy. By way of example (without limiting and foregoing), we may be forced to disclose information to the government, law enforcement agencies or third parties. Under certain circumstances, third parties may unlawfully intercept or access transmissions or private communications, or members may abuse or misuse your information that they collect from our Websites. Therefore, although we use industry standard practices to protect your privacy, we do not promise, and you should not expect, that your personally identifiable information or private communications will always remain private. </p>\r\n<p>As a matter of policy, we <strong>do not</strong> sell or rent any personally identifiable information about you to any third party. However, the following describes some of the ways that your personally identifiable information may be disclosed. </p>\r\n<p><b>Financial Information.</b> Under some circumstances we may require some additional information, such as, but not limited to credit card details. We use this financial information, including your name, address, and other information, as well as to bill you for use of our services. We use your financial information to check your qualifications, to bill you for services and/or products, to enable you to participate in discount, rebate and similar programs in which you may elect to participate. By making a purchase, or engaging in any other kind of activity or transaction that uses financial information on the Websites, you consent to our providing of your financial information to our service providers and to such third parties as we determine are necessary to support and process your activities and transactions, as well as to your credit card issuer for their purposes. These third parties may include the credit card companies and banking institutions used to process and support the transaction or activity. By purchasing, or registering or making reservations for products or services of third parties offered on the Websites, or by participating in programs offered on the Websites that are administered by third parties and that require you to submit financial information in order to use them, you also consent to our providing your financial information to those third parties. Any of these various third parties may be authorized to use your financial information in accordance with our contractual arrangements with such third parties and in accordance with their own privacy policies, over which we have no control, and you agree that we are not responsible or liable for any of their actions or omissions. Additionally, you agree that we may use and disclose all such information so submitted to such third parties in the same manner in which we are entitled to use and disclose any other information that you submit to us. </p>\r\n<p><b>Advertisers. </b>We aggregate (gather up data across all our members'' accounts) personally identifiable information and disclose such information in a non-personally identifiable manner to advertisers and other third parties for other marketing and promotional purposes. However, in these situations, we do not disclose to these entities any information that could be used to identify you personally. Certain information, such as your name, email address, password, credit card number and bank account number, are never disclosed to marketing advertisers. We may use third-party advertising companies to serve ads on our behalf. These companies may employ cookies and action tags (also known as single pixel gifs or web beacons) to measure advertising effectiveness. Any information that these third parties collect via cookies and action tags is completely anonymous. </p>\r\n<p><b>External Service Providers. </b>There may be a number of services offered by external service providers that help you use our Websites. If you choose to use these optional services, and in the course of doing so, disclose information to the external service providers, and/or grant them permission to collect information about you, then their use of your information is governed by their private policy. </p>\r\n<p><b>Other Corporate Entities. </b>We share much of our data, including personally identifiable information about you, with our parent and/or subsidiaries that are committed to serving your online needs and related services, throughout the world. To the extent that these entities have access to your information, they will treat it at least as protectively as they treat information they obtain from their other members. Our parent and/or subsidiaries will follow privacy practices no less protective of all members than our practices described in this document, to the extent allowed by applicable law. It is possible that We and/or its subsidiaries, or any combination of such, could merge with or be acquired by another business entity. Should such a combination occur, you should expect that we would share some or all of your information in order to continue to provide the service. You will receive notice of such event (to the extent it occurs) and we will require that the new combined entity follow the practices disclosed in this Privacy Policy. </p>\r\n<p><b>Legal Requests. </b>we cooperates with law enforcement inquiries, as well as other third parties to enforce laws, such as: intellectual property rights, fraud and other rights. We can (and you authorize us to) disclose any information about you to law enforcement and other government officials as we, in our sole discretion, believe necessary or appropriate, in connection with an investigation of fraud, intellectual property infringements, or other activity that is illegal or may expose us or you to legal liability. </p>\r\n<p>5. <b>Your Use of other Members Information</b></p>\r\n<p>Our services also include access to instant messaging and chat rooms. As a member you have access to the Member''s ID No., and you might gain access to other contact information of the Member(s) through the regular use of the instant messaging and chat rooms. By accepting this Privacy Policy, you agree that, with respect to other Members'' personally identifiable information that you obtain through instant messaging communication, the chat rooms and email, We hereby grants to you a license to use such information only for: (a) Your Company related communications that are not unsolicited commercial messages, and (b) any other purpose that such member expressly agrees to after adequate disclosure of the purpose(s). In all cases, you must give Members an opportunity to remove themselves from your database and a chance to review what information you have collected about them. In addition, under no circumstances, except as defined in this Section, can you disclose personally identifiable information about another member to any third party without our consent and the consent of such other member after adequate disclosure. [Your Company] and our members do not tolerate spam. Therefore, without limiting the foregoing, you are not licensed to add a [Your Company] member to your mail list (email or physical mail) without their express written consent after adequate disclosure. To report spam from other [Your Company], please <a href="#CONTACTUS#">Contact Us</a>. </p>\r\n<p>6. <b>Accessing, Reviewing and Changing Your Profile</b></p>\r\n<p>Following registration, you can review and change the information you submitted during registration through the Member Service Menu including: Your password and e-mail address. If you change your password and email we keep track of your old password and email. You can also change your registration information such as: name, address, city, state, zip code, country, phone number, profile, likes and dislikes, desired date profile, essays and saves search criteria. </p>\r\n<p>Upon your written request, we will suspend your membership, contact information, and financial information from our active databases. Such information will be suspended as soon as reasonably possible in accordance with our suspension policy and applicable law. To remove your profile so that others cannot view it, visit the <a href="#CANCEL#">Remove Your Profile</a> section of Member Services. </p>\r\n<p>We will retain in our files information you have requested to remove for certain circumstances, such as to resolve disputes, troubleshoot problems and enforce our terms and conditions. Further, such prior information is never completely removed from our databases due to technical and legal constraints, including stored ''back up'' systems. Therefore, you should not expect that all of your personally identifiable information will be completely removed from our databases in response to your requests. </p>\r\n<p>7. <b>Control of Your Password</b></p>\r\n<p>You are responsible for all actions taken with your login information and password, including fees. Therefore we do not recommend that you disclose your [Your Company] password or login information to any third parties. If you choose to share this information with third parties to provide you additional services, you are responsible for all actions taken with your login information and password and therefore should review each third party''s privacy policy. If you lose control of your password, you may lose substantial control over your personally identifiable information and may be subject to legally binding actions taken on your behalf. Therefore, if your password has been compromised for any reason, you should immediately change your passwod</p>\r\n<p>8. <b>Other Information Collectors</b></p>\r\n<p>Except as otherwise expressly included in this Privacy Policy, this document only addresses the use and disclosure of information we collect from you. To the extent that you disclose your information to other parties, whether they are on our Websites or on other sites throughout the Internet, different rules may apply to their use or disclosure of the information you disclose to them. To the extent that we use third party advertisers, they adhere to their own privacy policies. Since [Your Company] does not control the privacy policies of the third parties, you are subject to ask questions before you disclose your personal information to others. </p>\r\n<p>9. <b>Security</b></p>\r\n<p>[Your Company] uses industry standard practices to safeguard the confidentiality of your personal identifiable information, including "firewalls" and Secure Socket Layers. [Your Company] treats data as an asset that must be protected against loss and unauthorized access. We employ many different security techniques to protect such data from unauthorized access by members inside and outside the company. However, "perfect security" does not exist on the Internet. </p>\r\n<p>10. <b>Notice</b></p>\r\n<p>We may change this Privacy Policy from time to time based on your comments and our need to accurately reflect our data collection and disclosure practices. All changes to this policy are effective after we provide you with at least (30) days notice of changes by sending email to members. We provide you with (30) days notice to allow you the opportunity to notify [Your Company] if you do not agree to such changes.</p>');
INSERT INTO `[prefix]_pages` (`id`, `pagekey`, `title`, `pagetext`) VALUES (3, 'about_us', 'About Us', 'Your company information here.');
INSERT INTO `[prefix]_pages` (`id`, `pagekey`, `title`, `pagetext`) VALUES (4, 'faq', 'FAQ', '<a id="pass" name="pass"></a><b><font face="Verdana, Arial, Helvetica, sans-serif">How do I change my email address or password?</font></b></p>\r\n<p><font face="Verdana, Arial, Helvetica, sans-serif">You can change your email address&nbsp;on the "edit your profile" page. Here you can change some other information including search preferences, address and other preferences about your daily routines, habits, hobbies etc.<br /><br />After you''ve made your changes, click "Save" at the bottom of the page to save.</font></p>\r\n<p><a id="look" name="look"></a><a id="look2" name="look2"></a><a id="married" name="married"></a><strong><font face="Verdana, Arial, Helvetica, sans-serif">What is the purpose behind Instant Messenger, how do i get benefit from it?</font></strong></p>\r\n<p><font face="Verdana, Arial, Helvetica, sans-serif">This application is a faster way of communicating to other members of the site who&nbsp;are online. Its lists all the members who are online. When you send message, recipient&nbsp;will receive message and would reply. If&nbsp;unfortunately&nbsp;recipient doesn''t receive message for some reason, then that message will be send to his onsite message Inbox.</font></p>\r\n<p><strong><font face="Verdana, Arial, Helvetica, sans-serif">How does "My Matches" works?</font></strong></p>\r\n<p><font face="Verdana, Arial, Helvetica, sans-serif">My Matches works according to the basic profile and "search preferences" at the bottom of the&nbsp;"edit profile" page.</font></p>\r\n<p><b><font face="Verdana, Arial, Helvetica, sans-serif">Do people actually meet on your site? Do they ever get married?</font></b></p>\r\n<p><font face="Verdana, Arial, Helvetica, sans-serif">Thousands of people meet on our site daily and go on to date and start relationships. We''ve also had hundreds of marriages across many borders. To see for yourself, check the site for real stories of real connections.</font></p>\r\n<p><a id="respond" name="respond"></a><font face="Verdana, Arial, Helvetica, sans-serif"><b>When someone emails me, where does the email go and how do I respond?</b><br /><br />When a member sends you a note, it goes straight into your onsite message Inbox. We then send an email to your personal email address to let you know that it''s there. </font></p>\r\n<p><font face="Verdana, Arial, Helvetica, sans-serif">To read the note, simply login to the site and go to your Inbox. If you decide to write back, simply click "reply", write your own note and send away. Your note will go straight into the member''s onsite Inbox, and we''ll let them know it''s there with an email to their personal email address.</font></p>\r\n<p><font face="Verdana, Arial, Helvetica, sans-serif">All communications with other members stay onsite so that you never have to give out any personal information until you feel completely ready. Then when you are, you can exchange phone numbers and even meet in person.</font></p>\r\n<p><a id="edit" name="edit"></a><b><font face="Verdana, Arial, Helvetica, sans-serif">How do I edit my profile? How do I hide my profile?</font></b></p>\r\n<p><font face="Verdana, Arial, Helvetica, sans-serif">To update your profile, click "Edit Profile"&nbsp;in Members Panel menu. Be sure to save your changes at the bottom of the screen when you''re done.</font></p>\r\n<p><font face="Verdana, Arial, Helvetica, sans-serif">Try to put your best foot forward with at least one photo and snappy, detailed essays about your interests. The photo is key since most people feel more comfortable writing to members they can see. Try to stay positive in your essays and let the real you shine.</font></p>\r\n<p><font face="Verdana, Arial, Helvetica, sans-serif">To hide your profile, select "No" for the option "Other members can see when I''m online?" on the&nbsp;"Edit Profile" page &nbsp;. Keep in mind, however, that members who are most active on the site keep their profile visible in all places because it ups their chances of connecting with people. And you never know, someone special may be looking for you and never get to find you if your profile is hidden.</font></p>\r\n<p><a id="hold" name="hold"></a><b><font face="Verdana, Arial, Helvetica, sans-serif">When I suspend my membership, does it end my subscription? Can I put my subscription on hold?</font></b></p>\r\n<p><font face="Verdana, Arial, Helvetica, sans-serif">No. Once you purchase a subscription, it will remain active for the remainder of your initial term.</font>');
INSERT INTO `[prefix]_pages` (`id`, `pagekey`, `title`, `pagetext`) VALUES (5, 'services', 'Services', '<p><b>Powerful Matching Options</b></p><p>Find your perfect match by using our powerful matching features.</p><p>Use the Quick Search to find other members that are looking for someone just like you. Or use our Advanced Search  to pick and choose from many different matching options. Once you\'ve created the perfect search, save it so you can use the same search again with ease.</p><p>Still finding too many matches? Look for someone nearby. Narrow your search down to those living around your own zip code (not available in all areas).</p><p>Plan on being out of town? Search for other members living near your destination and meet up while away.</p><p><b>Forums</b></p><p>Robust forum software allows you to post topics on issues from dating to sports to politics and anything in between.  Lively forums are a great place to find advice, debate issues and make new friends. </p><p>Forums, sometimes known as message or bulletin boards, allow our members to participate in on-going, in-depth discussions. This is different from "chat", where conversations are brief, visible only in real time to current participants, and disappear after a few moments. Forum posts are longer and remain visible allowing richer exchanges to take place.</p><p><b>Full Featured Chat</b></p><p>Full featured chat allows you to have real-time chat with other members. Multiple chat rooms are available for different chat topics.  Meet new friends! Chat is a great way to find new friends or partners, for fun, romance, dating and long term relationships. Meeting and socializing with people online is both fun and entertaining.</p><p>Private chat sessions are also available for those private, intimate conversations with close friends.<p><b>Internal Mail Messaging</b></p><p>A fully integrated messaging system is available for you to email other members anonymously and safely. By using our messaging system, you won\'t have to reveal your real e-mail address or other personal information. </p><p>You can also create custom mail templates if you find yourself sending the same message again and again. When creating a templates you can make use of "template variables" for you to personalize your messages. Automatically include your profile data with any message that you send. </p><p><b>Send a Wink</b></p><p>See someone you\'re interested in but don\'t want to email? Send them a wink to let them know.</p><p><b>Friends and Hot People List</b></p><p>Build your own private friends list to keep track of their usernames, and to share photos and events. Use it for your main contact list!</p><p>If you see someone you\'re interested in put them on your Hot People list and build your own Little Black Book.</p><p><b>Banned People</b></p><p>Tired of being bothered by the same losers over and over? Put them on your banned list and you become invisible to them.</p><p><b>Profile Views and Winks List</b></p><p>Want to see who\'s checking you out? Look at the Views list to see who has visited your profile. And when you receive a Wink, check out the Winks List to see who\'s interested in you! </p><p><b>Photo Gallery</b></p><p>Upload your photos and keep them private for you and your friends, or allow them to be viewed by everyone. Advanced gallery features include multiple album management and automatic thumbnails generation.</p><p>Built in photo editing allows you to crop or resize your photos after uploading.</p><p><b>Event Calendar</b></p><p>We offer a built in calendar so you can keep track of your events. See public events planned for members of the community, or track your own dates, such as birthdays or anniversaries.</p>');
