INSERT INTO `[prefix]_stories` (`storyid`, `date`, `sender`, `header`, `text`, `enabled`) VALUES (1, 1119769809,'' , 'My Story', 'What initially started out as something to relieve a little boredom and to have some fun turned into one of the most beautiful experiences, one that I will carry with me forever... <br /><br />I have met a lot of people in my life, and honestly thought that I would never meet the person who ''completes'' me...one almost accepts that this is your life and how it''ll always be... <br /><br />That was until I met the most amazing man on your site, it''s still fairly new but I knew from the moment I saw his eyes, (the most beautiful eyes I''ve ever seen) that he would take me to a place I''ve longed to be and bring back my smile forgotten... <br /><br />I now firmly believe that it''s only after you stop looking for something, that it''ll eventually find you?!? <br /><br />There aren''t words to describe him really... he is someone/something you have to experience to understand... the most intense eyes, beautiful smile, personality like no other, the deepest of souls, a heart you can''t help but love yet so mysterious that you keep coming back for more... he is my enigma!?! <br /><br />Where this road leads, one can''t be sure but I know in my heart that it''s been worthwhile as my life has been enriched just by knowing him... <br /><br />In the old end... I''ll always be able to look back and smile... <br /><br />Thank you!! <br /></p>', 'Y');
INSERT INTO `[prefix]_stories` (`storyid`, `date`, `sender`, `header`, `text`, `enabled`) VALUES (2, 1119769957,'' , 'In each other''s arms this Christmas!', 'Met Pietro on here a year ago (he has put his success story on too). He kept asking for a date but I kept putting him off!!!! I finally agreed to meet up in October of this year and we hit it off straight away. We have seen each other every weekend since then. \r\n<br /><br />\r\nHe has met all my friends and my work colleagues and they think he is great too!!! We attended my works christmas dinner last Saturday and he made me feel so special and relaxed.\r\n<br /><br />\r\nNever thought I would meet someone so lovely. Pietro, I love you. Thank you midsummers for bringing us together! Have a great christmas and a happy new year! I know we will because we will be in each others arms.xxxxxx\r\n<br /><br />\r\nSee ''Have met a wonderful girl'' for Pietro''s story.\r\n<br />\r\n', 'Y');
INSERT INTO `[prefix]_stories` (`storyid`, `date`, `sender`, `header`, `text`, `enabled`) VALUES (3, 1119290400,'' , 'I am the happiest I have ever been', 'My friend introduced me to midsummers. Basically I live in an Army hostel for estranged wives and found it really difficult to get a baby sitter to meet people. So I thought I''d give the internet dating thing a go. <br /><br />I had a message from Pete25 who wanted to know what I looked like so I gave him my mob number and told him I could only send a pic through my phone. <br /><br />Not long after that I got a call from him and we chatted and then a couple more. Then one night we spent 4hrs and 45mins on the phone. 2 days later we met and instantly fell for each other. <br /><br />I am the happiest I have ever been. We are so meant to be together. I have actually fallen in love with him and can see a bright happy future together. A big thank you to Midsummers for giving me the man of my dreams.x <br />', 'Y');
